import Button from './Button.js'

function Login() {
    return (
      <div className="Login">
        <h1> Welcome To ByteBod </h1>
        <h2> Join our community </h2>
        <Button>Login</Button>
        <Button>Sign Up</Button>
      </div>
    );
  }

  export default Login;
